class ballObj{ x:number; y:number; dx:number; dy:number; rad:number; speed:number;
	constructor(x:number, y:number,	dx:number, dy:number, rad:number, speed:number)
	{
		this.x = x;
		this.y = y;
		this.dx = dx;
		this.dy = dy;
		this.rad = rad;
		this.speed = speed;
	}
}
export default ballObj
